import React from 'react';
import './home.css';  // Import the CSS for styling
import image0 from '../assets/image_0.jpg';  // Import the image correctly

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-logo">
        <img src={image0} alt="aavb logo" />  {/* Use imported image */}
      </div>
      
      <div className="home-content">
        <h1>Welcome to Our Company</h1>
        <p className="intro-text">Manage employees and equipment easily.</p>
        
        <section className="features">
          <h2>Features</h2>
          <p>Overview of managing employees, assigning equipment, and generating reports.</p>
        </section>

        <section className="services">
          <h2>Services</h2>
          <p>Details about employee management, equipment tracking, and more.</p>
        </section>

        <section className="testimonials">
          <h2>What Our Clients Say</h2>
          <p>Customer testimonials and feedback on our services.</p>
        </section>
      </div>
    </div>
  );
};

export default Home;
